import React from 'react';
import { withRouter } from "react-router-dom";

class EndPage extends React.Component {

  redirect = () => {
    this.props.history.push('/step')
  }

  render() {
    return(
    <div className="container h-100 position-absolute">
        <div className="row align-items-center h-33 pink">
            <div className="col-10 mx-auto text-center">
                <h1><b>Diet</b></h1><br/>
                Your score
            </div>
        </div>
        <div className="row align-items-center h-33">
            <div className="col-10 mx-auto text-center">
                <b>UK National average:</b> 2.9 Tons<br/>
                of CO2 produced per year<br/>
                Loading bar<br/>
                <b>Your using 3.2 Tons of CO2 / year</b>
            </div>
        </div>
        <div className="row align-items-center h-33">
            <div className="col-10 mx-auto text-center">
                <b>Lets take a look at how you look in the Home category...</b><br/>
                <button type="button" className="btn btn-lg btn-block" style={{'background-color': '#48B07A', 'border-color': '#48B07A', 'color': '#fff', 'border-radius': '0'}}>Continue</button>
            </div>
        </div>
    </div>
    );}
}

export default withRouter(EndPage);
